import React from 'react';
import './HomePage.css';

const HomePage = () => {
  return (
    <div className="gallery-container">
      <h1 className="welcome-message">Welcome to TravelMate!</h1>
      <div className="image-gallery">
        <img src="/images/image1.jpg" alt="Travel Destination 1" />
        <img src="/images/image2.jpg" alt="Travel Destination 2" />
        <img src="/images/image3.jpg" alt="Travel Destination 3" />
        {/* Add more images as desired */}
      </div>
    </div>
  );
};

export default HomePage;
